[["Nombre d\'enfants","8","<div>\n<i class=\"NoteType\">\nNote sur l\'attribut\n</i>\n<div class=\"grampsstylednote\">\n<p>\nCourtesy of pyschoanalyze-pinhead from Emacs.\n</p>\n<p>\nI am the psychotherapist.  Please, describe your problems.  Each time<br />\nyou are finished talking, type RET twice.\n</p>\n<p>\nSHHHH!!  I hear SIX TATTOOED TRUCK-DRIVERS tossing ENGINE BLOCKS<br />\n into empty OIL DRUMS..\n</p>\n<p>\nWhy do you say that?\n</p>\n<p>\nI have accepted Provolone into my life!\n</p>\n<p>\nWhat makes you believe you have accepted provolone into your life?\n</p>\n<p>\nIt\'s 74 degrees, 12 minutes NORTH, and 41 degrees, 3 minutes EAST!!<br />\n Soon, it will be TUESDAY!!\n</p>\n<p>\nMaybe your plans have something to do with this.\n</p>\n<p>\nGOOD-NIGHT, everybody..  Now I have to go administer FIRST-AID<br />\n to my pet LEISURE SUIT!!\n</p>\n<p>\nI don\'t understand.\n</p>\n<p>\nI\'m QUIETLY reading the latest issue of ``BOWLING WORLD\'\'<br />\n while my wife and two children stand QUIETLY BY..\n</p>\n<p>\nTell me something about your family.\n</p>\n<p>\nHow do I get HOME?\n</p>\n<p>\nIs it because do you get home that you came to me?\n</p>\n<p>\nKids, the seven basic food groups are GUM, PUFF PASTRY, PIZZA,<br />\n PESTICIDES, ANTIBIOTICS, NUTRA-SWEET and MILK DUDS!!\n</p>\n</div>\n</div>",[1594,1595]]],
